import ImageSlider from '../../components/imageSlider/imageSlider';
import RadioBtnSlider from '../../components/radioBtnSlider/radioBtnSlider';

const whatwedo = () => {

    const imageProperties = [{"image_details": "slide first","image":"web1.jpg","category":"web"},
                             {"image_details": "slide second","image":"web2.jpg","category":"web"},
                             {"image_details": "slide third","image":"web3.jpg","category":"web"},
                             {"image_details": "slide forth","image":"mobile1.jpg","category":"mobile"},
                             {"image_details": "slide fith","image":"mobile2.jpg","category":"mobile"},
                             {"image_details": "slide sixth","image":"mobile3.jpg","category":"mobile"},
                             {"image_details": "slide seventh","image":"automation1.jpg","category":"automation"},
                             {"image_details": "slide eighth","image":"automation2.jpg","category":"automation"},
                            ];
    const radioProperties = [{"id":"radio1","category":"web"},
                             {"id":"radio2","category":"web"},
                             {"id":"radio3","category":"web"},
                             {"id":"radio4","category":"mobile"},
                             {"id":"radio5","category":"mobile"},
                             {"id":"radio6","category":"mobile"},
                             {"id":"radio7","category":"automation"},
                             {"id":"radio8","category":"automation"},
                            ];

    return <div>
                <ImageSlider imageProperties={imageProperties}/>
                <RadioBtnSlider radioProperties={radioProperties}/>
           </div>

}

export default whatwedo;
